import styles from './Project.scss';

const Project = ({title, paragraph, image}) => {
  console.log(title);
  return (
    <div className={styles.wrapper}>
      <h3 className={styles.title}>{title}</h3>
      <p className={styles.paragraph}>{paragraph}</p>
      <img>{image}</img>
    </div>
  );
};

export default Project;
